import React from 'react';
import {Dialog, DialogTitle, IconButton, DialogContent, DialogActions, Button, Typography} from '@material-ui/core'
import {CloseOutlined} from '@material-ui/icons'

import {FormState} from '../interfaces/interfaces'

interface ModalWindowProps {
  visible: boolean;
  onClose: () => void;
  offer: FormState | undefined;
  depositName: string;
}

export const ModalWindow: React.FC<ModalWindowProps> = ({onClose, visible, depositName, offer}: ModalWindowProps): React.ReactElement => {
  return (
    <>
      <Dialog
        open={visible}
        onClose={onClose}
        aria-labelledby="form-dialog-title"
        fullWidth
      >
        <DialogTitle>
          Предложение от банка
          <IconButton
            onClick={() => {
              onClose();
            }}
            color="secondary"
            aria-label="close"
          >
            <CloseOutlined style={{ fontSize: 26 }} color="primary" />
          </IconButton>
        </DialogTitle>
        <DialogContent>
          <Typography>
          <p>Тип депозита: {depositName}</p>
          </Typography>
          <Typography>
          <p>Срок: {offer?.period}</p>
          </Typography>
          <Typography>
          <p>Сумма: {offer?.summ}</p>
          </Typography>
          <Typography>
          <p>Процентная ставка: {offer?.rate}</p>
          </Typography>
          <Typography>
          <p>Доход: {offer?.profit}</p>
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button
            variant={'contained'}
            color={'primary'}

          >
            Печать
          </Button>
        </DialogActions>
      </Dialog>
    </>
  );
};
